 @RodolfoAnderson-qi6zg  O problema não é esse cara, o problema é tratarem o Suarez como se fosse um Ronaldo Fenômeno ou Romário que já jogou e muito nas nossas terras e conquistaram coisas grandes.
Por isso que eu disse essa geração se apega a qualquer coisa.
Eu tenho pena dessa geração de verdade, Suarez fez toda sua história no futebol europeu e sim é um dos maiores mas no Gremio e sua passagem no Brasil foi um jogador que foi goleador é isso, como muitos outros que tivemos, o grande problema é que o pessoal romantiza muito isso.
